useEffect(()=>{
   fetch("https://api.quicksell.co/v1/internal/frontend-assignment").then((data)=>{
  return data.json()
   }).then((parsedData)=>{
    setData(parsedData)
   }).catch(e=>{
    setData([])
})

},[])

